import classes from './Container.module.css';
import Buttons from './Buttons/Buttons';
import MainImage from './MainImage';
import Authorization from './Authorization/Authorization';
import {Routes, Route, Link} from 'react-router-dom';
import News from '../NewsSection';
import Documents from '../Documents';
import TaskBank from '../TaskBank';

const Container = () => {
  return (
    <div className={classes.Container}>
      <main className={classes.Content}> 
      <Buttons text={'Архив заданий регионального этапа ВсОШ по физике'}>
      </Buttons>
      <Buttons text={'Новости'} >
        <Link to="/news"></Link>
      </Buttons>
      <Buttons text={'Документы'} ></Buttons>
      <MainImage src='./girl.png'/>
      <Authorization/>
      </main>
      <Routes>
        <Route path="/tasks" element={<TaskBank />}/>
        <Route path="/news" element={<News />}/>
        <Route path="/documents" element={<Documents />}/>
      </Routes>
    </div>

    
  )
}

export default Container;
